    return "<h3><span class=\"stepTitle\">Step 1:</span>\n</br> <span class=\"steps\">Sign-up up for a five-lesson City Talk conversational English, culture and worldview class online or in-person at our Silom English center. The classes are taught by TESOL certified native English speakers and are offered at an introductory cost of 399 Baht! Click here for details, restrictions and available class times. Or, sign-up for a City Talk class at partnering universities and businesses. If you would like information on how your business or school can sponsor on-site City Talk classes, click here for more information. Currently, we are offering limited on-site classes in Sathorn and Bangrak districts.</span></h3>";
